import asean from '../../assets/cooperation/asean.webp';
import registration from '../../assets/cooperation/registration.webp';

const photosInfo = [
  {id: "asean", name: "asean", image: asean, title: "ASEAN", desc: "Presidents" },
  {id: "registration", name: "registration", image: registration, title: "Company registration", desc: "description" },
]

export default photosInfo;
